import styled from 'styled-components'

export const Centering = styled.div`
    display:flex;
    flex-direction:column;
    align-items:center;

`
export const Container = styled.div`
    display:flex; 
    flex-direction:column;
    justify-content:center;
    align-items:center;
    gap:5px;
    background: #d3dbd3;

    width:fit-content;
    padding:15px;
    border-radius:30px;

`
export const Button = styled.button`
    border-radius:30px;
    padding: 15px 20px;
    font-family: Monsterrat, sans-serif;
    background: #A3BDA7;
    border:none;
    font-size:18px;

`

export const LoginButtonDiv = styled.div`
    display:flex;
    justify-content:center;
    padding:20px;
    margin:5px;
    border-radius:30px;


`
